#Count nucleotides frequence
nucleotide = ['A', 'C', 'G', 'T']

def count_nuc_frequence(sequence):
    if not sequence:
        return "Invalid DNA sequence"
    
    count = {}
    for nuc in nucleotide:
        count[nuc] = sequence.count(nuc)
    
    return count

sequence = ""
result = count_nuc_frequence(sequence)

print(*result.values())